// Row.js
import React from 'react';

function Row() {
  return (
    <div className="row">
     <span>{title}</span>
      <span>{genre}</span>
      <span>{releaseDate}</span>
      <span>{hltb}</span>
      <span>{timePlayed}</span>
      <span>{status}</span>
      <span>{score}</span>
    </div>
  );
}

export default Row;
